        let mapPinSymbolRect = CGRectMake(frame.minX, frame.minY, frame.width, frame.height)
        CGContextSaveGState(context)
        UIRectClip(mapPinSymbolRect)
        CGContextTranslateCTM(context, mapPinSymbolRect.origin.x, mapPinSymbolRect.origin.y)

        StyleKit.drawMapPin(frame: CGRectMake(0, 0, mapPinSymbolRect.size.width, mapPinSymbolRect.size.height), defaultColor: restaurantParameterColor)
        CGContextRestoreGState(context)


        //// Symbol Drawing
        let symbolRect = CGRectMake(frame.minX + floor(frame.width * 0.21667 + 0.5), frame.minY + floor(frame.height * 0.15000 + 0.5), floor(frame.width * 0.80000 + 0.5) - floor(frame.width * 0.21667 + 0.5), floor(frame.height * 0.58750 + 0.5) - floor(frame.height * 0.15000 + 0.5))
        CGContextSaveGState(context)
        UIRectClip(symbolRect)
        CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y)

        StyleKit.drawRestaurantIcon(frame: CGRectMake(0, 0, symbolRect.size.width, symbolRect.size.height), defaultColor: restaurantParameterColor)
        CGContextRestoreGState(context)
    }

